import React from 'react';

const skills = {
  "Programming Languages": ["Python", "Java", "C++", "JavaScript"],
  "Data Analysis & Visualization": ["Power BI", "Tableau", "Matplotlib", "Pandas"],
  "Machine Learning & AI": ["TensorFlow", "PyTorch", "Scikit-learn", "Keras"],
  "Big Data Technologies": ["Apache Hadoop", "Apache Spark", "Apache Kafka"],
  "Cloud Platforms": ["AWS", "Google Cloud Platform (GCP)", "Microsoft Azure"],
  "Database Management": ["PostgreSQL", "MySQL", "MongoDB", "Oracle"],
  "Web Development": ["HTML", "CSS", "React.js", "Node.js"],
  "DevOps Tools": ["Docker", "Kubernetes", "Jenkins", "Git"],
  "Version Control": ["Git", "GitHub", "GitLab"],
  "Software Development Life Cycle (SDLC)": ["Agile", "Scrum", "Waterfall"],
};

function Skills() {
  return (
    <section id="skills">
      <h2>Skills</h2>
      <div className="skills-grid">
        {Object.keys(skills).map((category, index) => (
          <div className="skill-category" key={index}>
            <h3>{category}</h3>
            <ul>
              {skills[category].map((skill, i) => (
                <li key={i}>{skill}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Skills;
